                berserkerDFinal = Math.ceil((berserkerInf + berserkerCav + berserkerArc) / wallmodifier)
                trebuchetDFinal = Math.ceil((trebuchetInf + trebuchetCav + trebuchetArc) / wallmodifier) + sumSiege
